//=======================================================
// HTML5 Speaking 啟始的設定檔
//=======================================================

//------------------------------
//啟始對話框的設定
//------------------------------
//標題字
startupDialogCaption = 'HTML5 FUN Speaking';

//說明文字(支援多行, 換行就加上「\n」
startupDialogDescription = '☆\n★★★ 看看提示 ★★★\n☆\n\n☆\n★★★ 說說答案 ★★★\n☆';

//按鈕上的文字
startupDialogButtonCaption = '開始';

//說明文字對齊的方式: left , right, center
startupDialogTextAlign = 'center';

//------------------------------
//預設的遊戲說明對話框的設定
//可能會被 [題庫設定] 的設定值取代
//------------------------------
//標題字
helpDialogCaption = 'HTML5 FUN Speaking';

//說明文字(支援多行, 換行就加上「\n」
helpDialogDescription = '1.觀察畫面中央的提示。\n\n2.按麥克風的按鈕，變紅色麥克風後，以英文說出提示的單字，或是拼出單字。\n\n3.按 Check 鈕，送出答案。';

//按鈕上的文字
helpDialogButtonCaption = '開始';

//說明文字對齊的方式: left , right, center
helpDialogTextAlign = 'left';

//------------------------------
//預設的遊戲模式按鈕文字
//可能會被 [題庫設定] 的設定值取代
//------------------------------
gameMode_1_Caption = '看英文\n說英文';	//模式1:題庫第1欄為問題，也是提示
gameMode_2_Caption = '看英+中\n說英文';	//模式2:題庫第1欄為問題，第1欄和第2欄為提示
gameMode_3_Caption = '看中文\n說英文';	//模式3:題庫第1欄為問題，第2欄和第3欄為提示

//------------------------------
//預設的語音辨識參數
//可能會被 [題庫設定] 的設定值取代
//------------------------------
speechRecognitionContinuous = false;	//是否一直保持監聽辨識的狀態
speechRecognitionLang = 'en-US'; 		//語音辨識的語言 英文: 'en-US' , 中文: 'zh-TW'
speechRecognitionInterimResults = true; //是否有辨識結果就立即語音回報

//------------------------------
//預設的是否可用鍵盤輸入
// (false:禁用, true:可用)
//可能會被 [題庫設定] 的設定值取代
//------------------------------
enableKeyboardInput = false;


//--------------------------------------------------------------
// 音效設定
//--------------------------------------------------------------

//是否使用音效(false:禁用, true:使用)
//iOS 預設為 false, 其它瀏覽器預設為 true
//有需要時，可以將下一行的兩個斜線刪掉後自訂
//enableSound = false;

//
//音效(base64編碼)
//麥克風按鈕
sound_mic_mp3 = 'data:audio/mpeg;base64,';

//答對
sound_ok_mp3 = 'data:audio/mpeg;base64,';

//答錯
sound_ng_mp3 = 'data:audio/mpeg;base64,';

//Ding Dong
sound_ding_dong_mp3 = 'data:audio/mpeg;base64,';
